javaletteLex :: String -> Either String [Token]
javaletteLex str = runAlex str $ do
	let loop = do
			tok <- alexMonadScan
			case tok of
				TEOF -> do 
						   sc <- alexGetStartCode
						   if (sc == mlcomment) 
								then return $ [TFalseLiteral]
								else return $ [TTrueLiteral]
				TError -> do 
						   sc <- alexGetStartCode
						   if (sc == mlcomment) 
								then return $ [TFalseLiteral]
								else return $ [TTrueLiteral]
				_ -> liftM (tok:) loop
	loop


